import styled from "styled-components";
import COLOR from "./COLOR";
import BoxShadow from "./StyleComponents";

const ActiveContainer = styled.div`
    background-color: ${COLOR.White};
    border-radius: 0.8rem;
    width: 13.8rem;
    height: 11.5rem;
    ${BoxShadow}
    text-align: center;

    &:nth-child(1) {
        grid-column: 1/2;
        grid-row: 2/3;
    }
    &:nth-child(2) {
        grid-column: 2/3;
        grid-row: 2/3;
    }
    &:nth-child(3) {
        grid-column: 3/4;
        grid-row: 2/3;
    }
`
const Count = styled.span`
    font-size: 34px;
    font-weight: bold;
`

function ActiveCount ({ nameTitle }) {
    return (
        <ActiveContainer>
            <Count>10</Count>
            <span>{nameTitle}</span>
        </ActiveContainer>
    )
}

export default ActiveCount;
